import "./App.css";
import logo from "./Assets/Images/logo-falcone.jpg";

function App() {
  return (
    <>
      <navbar>
        <img src={logo} alt="logo" className="logo-image" />
      </navbar>
      <section>
        <div className="hero-image hero-image--mountains hero-flex">
          <div className="hero-title">
            Fly high <br /> as fuck!
          </div>
          <div className="">scroll to explore</div>
        </div>
      </section>
      <section>2</section>
      <section>3</section>
      <section>4</section>
    </>
  );
}

export default App;
